import React from "react";

const loginStyle = {
  position: "relative",
  top: "28vh",
  left: "5vw",
  width: "400px",
  height: "70px",
  fontSize: "25px",
  border: "none",
  borderBottom: "2px solid #00282a",
  backgroundColor: "transparent",
};

const LoginForm = () => {
  return (
    <div>
      {" "}
      <form>
        <p>
          <input
            className="Credentials"
            type="email"
            placeholder="Email"
            style={loginStyle}
          ></input>
        </p>
        <p>
          <input
            className="Credentials"
            type="password"
            placeholder="Password"
            style={loginStyle}
          ></input>
          <button className="ui button" type="submit">
            Submit
          </button>
        </p>
      </form>
    </div>
  );
};

export default LoginForm;
